import React from 'react';
import { Routes, Route } from 'react-router-dom';
import { AuthProvider } from './context/AuthContext';

/* ------- 蔚位委未蔚 ------- */
import Home from './pages/Home';
import Profile from './pages/Profile';
import MyBookings from './pages/MyBookings';
import NotFound from './pages/NotFound';
import Articles from './pages/Articles';
import Sitters from './pages/Sitters';
import Booking from './pages/Booking';
import Contact from './pages/Contact';
import Areas from './pages/Areas';
import AreaSitters from './pages/AreaSitters';

/* ------- components ------- */
import Login from './components/auth/Login.jsx';
import Register from './components/auth/Register.jsx';
import ForgotPassword from './components/auth/ForgotPassword.jsx';
import Header from './components/common/Header';
import Footer from './components/common/Footer';

function App() {
  return (
    <AuthProvider>
      <div className="fixed inset-0 -z-10 pointer-events-none overflow-hidden">
          {/*  paw prints */}
          <span className="shape" style={{ top: '15%', animationDelay: '0s' }}>
            <svg width="32" height="32" viewBox="0 0 24 24" fill="none" stroke="#0ea5e9" strokeWidth="2" strokeLinecap="round" strokeLinejoin="round"><path d="M12 2a5 5 0 0 1 5 5c0 1.5-.5 3-2 4l-3 3-3-3c-1.5-1-2-2.5-2-4a5 5 0 0 1 5-5z"/><path d="M12 12c-3.5 0-6.5 1.5-8 4l8 8 8-8c-1.5-2.5-4.5-4-8-4z"/></svg>
          </span>
          <span className="shape" style={{ top: '35%', animationDelay: '5s' }}>
            <svg width="32" height="32" viewBox="0 0 24 24" fill="none" stroke="#0ea5e9" strokeWidth="2" strokeLinecap="round" strokeLinejoin="round"><path d="M12 2a5 5 0 0 1 5 5c0 1.5-.5 3-2 4l-3 3-3-3c-1.5-1-2-2.5-2-4a5 5 0 0 1 5-5z"/><path d="M12 12c-3.5 0-6.5 1.5-8 4l8 8 8-8c-1.5-2.5-4.5-4-8-4z"/></svg>
          </span>
          <span className="shape" style={{ top: '55%', animationDelay: '10s' }}>
            <svg width="32" height="32" viewBox="0 0 24 24" fill="none" stroke="#0ea5e9" strokeWidth="2" strokeLinecap="round" strokeLinejoin="round"><path d="M12 2a5 5 0 0 1 5 5c0 1.5-.5 3-2 4l-3 3-3-3c-1.5-1-2-2.5-2-4a5 5 0 0 1 5-5z"/><path d="M12 12c-3.5 0-6.5 1.5-8 4l8 8 8-8c-1.5-2.5-4.5-4-8-4z"/></svg>
          </span>
          <span className="shape" style={{ top: '75%', animationDelay: '15s' }}>
            <svg width="32" height="32" viewBox="0 0 24 24" fill="none" stroke="#0ea5e9" strokeWidth="2" strokeLinecap="round" strokeLinejoin="round"><path d="M12 2a5 5 0 0 1 5 5c0 1.5-.5 3-2 4l-3 3-3-3c-1.5-1-2-2.5-2-4a5 5 0 0 1 5-5z"/><path d="M12 12c-3.5 0-6.5 1.5-8 4l8 8 8-8c-1.5-2.5-4.5-4-8-4z"/></svg>
          </span>

          {/* Υ bone */}
          <span className="shape" style={{ top: '20%', left: '10%', animationDelay: '0s' }}>
            <svg width="28" height="28" viewBox="0 0 24 24" fill="none" stroke="#8b5cf6" strokeWidth="2"><path d="M15 12c0 2.2-1.8 4-4 4s-4-1.8-4-4 1.8-4 4-4 4 1.8 4 4z"/><path d="M12 2v4m0 12v4m-6-10h4m8 0h4"/></svg>
          </span>
          <span className="shape" style={{ top: '60%', left: '80%', animationDelay: '3s' }}>
            <svg width="28" height="28" viewBox="0 0 24 24" fill="none" stroke="#8b5cf6" strokeWidth="2"><path d="M15 12c0 2.2-1.8 4-4 4s-4-1.8-4-4 1.8-4 4-4 4 1.8 4 4z"/><path d="M12 2v4m0 12v4m-6-10h4m8 0h4"/></svg>
          </span>

          {/*  ball */}
          <span className="shape" style={{ top: '40%', left: '85%', animationDelay: '1s' }}>
            <svg width="26" height="26" viewBox="0 0 24 24" fill="none" stroke="#10b981" strokeWidth="2"><circle cx="12" cy="12" r="10"/><path d="M12 2a15.3 15.3 0 0 1 4 10 15.3 15.3 0 0 1-4 10 15.3 15.3 0 0 1-4-10 15.3 15.3 0 0 1 4-10z"/></svg>
          </span>

